import '../../App.css';
import config from '../../config';

function Header() {
  return (
    <div style={{ top: 0, width: '100%', backgroundColor: 'blue', paddingTop: 10, display: 'flex', justifyContent: 'space-between' }}>
      <div style={{ display: 'flex', backgroundColor: 'red', marginLeft: 40, flexDirection: 'row', justifyContent: 'center', alignItems: 'center' }}>
        <div style={{ width: 45, height: 15, background: 'linear-gradient(90deg, rgba(158,184,191,1) 0%, rgba(111,140,164,1) 50%, rgba(50,67,110,1) 100%)' }} />
        <h1 style={{ marginRight: 15, marginLeft: 15, fontFamily: 'Tinos', color: config.colors.secondary }}>{config.COMPANYNAME}</h1>
        <div style={{ width: 45, height: 15, background: 'linear-gradient(270deg, rgba(158,184,191,1) 0%, rgba(111,140,164,1) 50%, rgba(50,67,110,1) 100%)' }} />
      </div>
      <div style={{ marginRight: 40, backgroundColor: 'green' }}>
        <h2 style={{ fontFamily: 'Newsreader', color: config.colors.secondary }}>Simplifiez vos finances !</h2>
      </div>
    </div>
  );
}

export default Header;
